import React from 'react';
import {Redirect, useHistory} from 'react-router-dom';
import {client} from '../Client';

const Logout = (props) => {
    const history = useHistory();
    history.push('/login');
    client.logout();
    return (
        <Redirect to='/login' />
    )
}

export default Logout;
